import React from 'react';
import './Meter2.css'
const Meter2 = () => {
    return (
        <div className="meter2Bg">
            <div className="row topRow">
                <p className="text-primary">Device / <span className='text-secondary'>Dashboard</span></p>
            </div>
            <div className="row topRow mt-3 pb-5">
                <h2>Dashboard</h2>
            </div>
            <div className="row">
                <div className="col-md-6 bg-custom">
                   <div className="bg-custom">
                   <div className="upperContent d-flex justify-content-between">
                       <h4>SENSOR</h4>
                       <img style={{width:'10%'}} src="https://static.vecteezy.com/system/resources/thumbnails/002/283/356/small/high-voltage-linear-icon-vector.jpg" alt="" />
                   </div> 
                   </div>
                </div>
                <div className="col-md-6"></div>
            </div>
        </div>
    );
};

export default Meter2;
